import HeaderPartial from '~/layouts/partials/HeaderWithNavbar.vue'
import NavbarPartial from '~/layouts/partials/Navbar.vue'
import FooterPartial from '~/layouts/partials/Footer.vue'

export default {
  props: {
    hideHeader: {
      type: Boolean,
      default: false
    },
    disableScroll: {
      type: Boolean,
      default: false
    }
  },
  data: function() {
    return {
      theme: 'light'
    };
  },
  methods: {
    setTheme(mode) {
        this.theme = mode
    }
  },
  components: {
    HeaderPartial,
    NavbarPartial,
    FooterPartial
  },

  metaInfo: {
    bodyAttrs: {
      class: "m-0"
